    private TablaDeSimbolos ts = new TablaDeSimbolos();
    private int erroresEncontrados = 0;

    public void printVars(){
        ts.printVars(System.out);
    }
    /**
    * Nos permite saber si se ha detectado un error:
    *   -true: Se ha detectado error
    *   -false: No se ha detectado error
    * En caso de true el funcionamiento será limitado hasta finalizar de procesar
    * la entrada, caso donde lo vuelve a poner a false.
    **/
    private boolean errorSemantic = false;
    
    /*
        -------------------GESTION DE ERRORES---------------------------
    */

    public void errorEncontrado(){
        errorSemantic= true;
        this.erroresEncontrados++;
    }

    @Override
    public void unrecovered_syntax_error(Symbol cur_token) throws Exception{
        report_error("Error sintactico irrecuperable", cur_token);
        done_parsing();
    }

    @Override
    public void syntax_error(Symbol cur_token){
        report_error("de sintaxis", cur_token);
    }
    
    @Override
    public void report_error(String message, Object info){
        StringBuilder msg = new StringBuilder("ERROR:");
        if(info instanceof Symbol){
            ComplexSymbol token = (ComplexSymbol) info;
            Location l = token.getLeft();

            if(l != null){
                msg.append(" (fila: " + l.getLine() + ", columna: " + l.getColumn() + ")");
            }
        }
        msg.append(": " + message);
        
        System.err.println(msg);
    }

    @Override
    public void report_fatal_error(String message, Object info) throws Exception{
        report_error("Error irrecuperable (" + message + ")", info);
        done_parsing();
    }

    public int getErroresEncontrados(){
        return erroresEncontrados;
    }

    /*
        ---------------------ESCRITURA DE CODIGO DE TRES DIRECCIONES---------------------
    */
    private int t; //Nos permitirá ir llevando la cuenta de variables temporales a usar
    private int e;
    BufferedWriter escritura;

    public void iniciarEscritura(){
        try{
            escritura = new BufferedWriter(new FileWriter("CodigoDirecciones.txt"));
        }catch(IOException e){
            System.out.println("Se ha producido un error al crear el archivo CodigoDirecciones.txt");
        }
        this.t= 0;
        this.e = 0;
    }
    
    public void putLine(String line){
        try{
            escritura.write(line);
        }catch(IOException e){
            System.out.println("Error al escribir en el fichero: " +line + " Error: " + e);
        }
        this.t++;
    }
    
    public void putEtiqueta(String line){
        try{
            escritura.write(line);
        }catch(IOException e){
            System.out.println("Error al escribir en el fichero: " +line + " Error: " + e);
        }
        this.e++;
    }
    
    public void close(){
        try{
            escritura.close();
        }catch(IOException e){
            System.out.println("Error al cerrar en el fichero. Error: " + e);
        }
    }


